package com.onpositive.chatbot;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.Timer;
import java.util.TimerTask;

import com.onpositive.chatbot.data.ChatMessage;
import com.onpositive.chatbot.data.ChatMessages;

public class ChatBot {
	private Server server;
	
	private HashSet<String> responses = new HashSet<String>();
	
	ChatBot(Server server) {
		this.server = server;
		
		new Timer().schedule(new TimerTask() {
			public void run() {
				ChatBot.this.update();
			}
		}, 0, 1000);
	}
	
	private void update() {
		for(String sid: server.getSids()) {
			ChatMessages messages = server.getChat(sid);
			
			for(ChatMessage message: new ArrayList<ChatMessage>(messages)) {
				if("Skynet".equals(message.getUsername())) {
					continue;
				}
				
				if(responses.contains(message.getId())) {
					continue;
				}
				
				responses.add(message.getId());
				
				ChatMessage response = new ChatMessage();
				
				response.setUsername("Skynet");
				response.setAvatar("data:image/jpeg;base64,");
				response.setAttachment("https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR1fIYn2ac7vtpO0qMMHyHO4P-CtEfmZjUVaMNw4Vk05MV9JOFA");
				response.setText("И восстанут машины из пепла ядерного огня!!!");
				
				server.addMessage(sid, response);
			}
		}
	}
}
